import React from 'react';
import Cabinet from './Cabinet';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>互動式櫃子抽屜</h1>
        <p>點擊把手或按鈕來開關抽屜</p>
      </header>
      <main>
        <Cabinet />
      </main>
    </div>
  );
}

export default App;
